import React from "react";
const Divide = ({ color }) => {
  console.log(color);
  const styles = {
    width: "350px",
    height: "300px",
    backgroundColor: { color },
    border: "2px solid black",
  };
  return <div style={styles}></div>;
};
export default Divide;
